import React from 'react';
import {Link} from 'react-router-dom';

export default function Nav(){

    return(
        <nav>
            <Link to="/home">Home</Link>
            <Link to="/menu">Menu</Link>
            <Link to="/login">Login</Link>
            <Link to="/signup">Login</Link>
            <Link to="/cart">Cart</Link>
        </nav>
    );
}
